import React from 'react';

const Login=()=>{
    return(
<div className='card'>
    <h2>Instagram</h2>
    <input type="text" placeholder="email"/>
    <input type="password" placeholder="password"/>

    <button className='btn'></button>

</div>
    )
}
export default Login;
